import { Routes, Route, useNavigate } from 'react-router-dom'
import { Header } from "./components/Header/Header";
import { Home } from "./components/Home/Home";

function App() {
  return (
    <>
       <div id="box">
      <Header />

      <main id="main-content">
        <Route path="/" element={<Home />} />

      </main>

       </div>
    </>
  );
}

export default App;
